        private string getFolder()
        {
            string folderPath = System.IO.Path.Combine(Environment.CurrentDirectory, "Comprovantes");
            if (!Directory.Exists(folderPath))
            {
                Directory.CreateDirectory(folderPath);
            }
            return folderPath;
        }
        public PdfPCell createImagePdf(PdfPTable tabela, byte[] rawImage, int percent, bool border)
        {
            if (rawImage == null)
            {
                PdfPCell empty = new PdfPCell();
                empty.Border = Rectangle.BOX;
                empty.BorderWidth = 0.5f;
                return tabela.AddCell(empty);
            }



            iTextSharp.text.Image imageInstance = Image.GetInstance(rawImage);



            if (percent == 0)
            {
                imageInstance.ScaleAbsolute(70f, 93f);
            }
            else
            {
                imageInstance.ScalePercent(percent);
            }




            PdfPCell image = new PdfPCell(imageInstance);
            image.HorizontalAlignment = Element.ALIGN_CENTER;
            image.VerticalAlignment = Element.ALIGN_MIDDLE;
            image.Border = Rectangle.NO_BORDER;



            if (border)
            {
                imageInstance.Border = Rectangle.BOX;
                imageInstance.BorderWidth = 1f;
            }



            return tabela.AddCell(image);



        }

        public PdfPCell AddCellCenter(String element)
        {
            PdfPCell cell = new PdfPCell();
            Paragraph elemento = new Paragraph(element);
            elemento.Alignment = Element.ALIGN_CENTER;
            elemento.SpacingAfter = 2;

            cell.AddElement(elemento);            

            return cell;
        }
